// SELECT busca igual en el campo estado retorna OK si existe el registro
//          retorna actualiza si es el mismo registro y tambien carga en la instancia
//          los valores de la lectura
// *************************************************************************************

    function buscaIgual_employee() {
        $estado = 'ERR';
                $this->db->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);
        try {
            $sql = 'SELECT * FROM employee WHERE ListID = :clave ';
            $stmt = $this->db->prepare($sql);
            $stmt->bindParam(':clave', $_SESSION['employee']['ListID']);
            $stmt->execute();
            $registro = $stmt->fetch(PDO::FETCH_ASSOC);
            if (!$registro) {
                $this->estado = 'OK';
            } else {
                if ($registro['ListID'] === $_SESSION['employee']['ListID']) {
                    $this->estado = 'ACTUALIZA';
                }
            }
        } catch (PDOException $e) {
            echo $e->getMessage();
        }

        return $this->estado;
    }

